import React from "react";
import { useEffect } from "react";

const HostVans = () => {
  useEffect(() => {
    fetch("/api/host/vans")
      .then((res) => res.json())
      .then((data) => console.log(data));
  }, []);
  return (
    <div>
      <h1>Host Vans</h1>
    </div>
  );
};

export default HostVans;
